import React from "react";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';
import "../App.css"
import "./Home.css"
import image1 from "../Photos/pexels-fauxels-3184419.jpg"
import image2 from "../Photos/pexels-thirdman-5256816.jpg"
import image3 from "../Photos/pexels-fauxels-3182773.jpg"

const Home = () => {
  const content = () =>{
    return (<>
      <Typography sx={{ margin:"5%" }} variant="h3" align="center">
        LPU Club Hiring
      </Typography>

      <div>
        <ul className="ul PathUL">
          <li>
          <Button size="lg" className="hiringBtn" variant="success">
            <Link to="/employer/dashboard">
              Hire Amazing talent
            </Link>
            </Button>
          </li>
          <li>
          <Button size="lg" className="hiringBtn" variant="success">
          {/* <Button variant="success"> */}
            <Link to="/employee/feed">
              Club Opening
            </Link>
            </Button>
          </li>
        </ul>
      </div>
      </>
    )
  }
  return (
    <div>

        <div className="card">{content}<img src={image1} alt="" /> </div>
        <div className="card">{content}<img src={image2} alt="" /></div>
        <div className="card">{content}<img src={image3} alt="" /></div>

    </div>
  );
};

export default Home;
